import React from 'react'
import { Form } from 'react-bootstrap'

export default function MyDropdown(params) {
  return (
    <Form.Select>
      <option value='NaN'>Select</option>
      {
        params.optionList.map((title,index)=>{
          return <option key={index}></option>
        })
      }
    </Form.Select>
  )
}
